import React, { Component } from "react";
import "./styles.scss";

class CoolSystem extends Component {
  render() {
    return (
      <div className="container-fluid p-0" id="cool">
        <div className="row cool-row"></div>
      </div>
    );
  }
}

export default CoolSystem;
